INSERT INTO `Hikes` (`hikeID`, `hikeName`, `parkingFee`, `weatherStatus`, `Rating`, `lastUpdated`, `reviews`, `dogFriendly`, `location`, `elevation gain`, `distance`, `photoID`, `userID`, `Description`) VALUES
(1, 'Rattlesnake Lake', 'National Parking Pass ', 'Rainy', 4, '2020-03-06 02:10:36', 'There is a beautiful lake at the beginning of the lake, perfect to swim during summer. Lovely view at the top, very popular.', 1, 'Snoqualmie Region -- North Bend Are', '1,175 feet', '5.1 miles ', 1, 0, 'Rattlesnake Ledge Trail  is a 5.1 mile heavily trafficked out and back trail located near North Bend, Washington that features a lake and is rated as moderate. The trail is primarily used for hiking and is accessible year-round. Dogs are also able to use this trail but must be kept on leash.'),
(2, 'Burroughs Mountain', 'National parking Pass', 'Rainy/Cloudy', 4, '2020-03-06 02:24:11', 'Gorgeous views no matter where you look! However, it is VVVVVEEEEERRRRRYYYYYY windy! I’m 5’1 and 145lbs and was blown over a few times at the top.', 0, 'Mount Rainier Area NE', '2,600 Feet', '5.4 Miles', 2, 0, 'Burroughs Mountain sets right up against the northeastern face of Mount Rainier, hugging the Winthrop Glacier. It offers one of the most dramatic views of Washington''s largest volcano; the landscape atop Burroughs is both broad and barren, so there is little to inhibit full exposure.'),
(3, 'Tolmie Peak', 'National Parking Pass ', 'Snowy', 5, '2020-03-06 02:24:21', 'Hiked on October 5th, it was a cloudy and rainy day, but fun hike overall. Didn’t have too great of a view due to cloud cover. ', 0, 'Mount Rainier Area NW', '1010 feet', '5.6 miles ', 3, 0, 'Tolmie Peak Trail is a beautiful hike past alpine lakes and subalpine meadows to a fire tower lookout with great views of the surrounding peaks and a commanding view of Mount Ranier. The two-story structure houses a lookout station on the upper level and storage at ground level.'),
(4, 'Crystal Peak ', 'National park Pass ', 'Rainy', 4, '2020-03-06 02:34:37', 'Very nice hike with great views\r\n\r\nTread is very good, so the climb passes quickly. Round trip time a bit over 4 hours.\r\n\r\nTrails is in very good condition. Some short patches of snow along the top part. Brought spikes but didn''t use them. Poles were nice to have.', 0, 'NE of Chinook Peak', '3,400 feet', '7.8 miles', 4, 0, 'Crystal Peak Trail is a 6.9 mile moderately trafficked out and back trail located near Ashford, Washington that features beautiful wild flowers and is rated as moderate. The trail is primarily used for hiking, walking, nature trips, and birding and is best used from June until October.'),
(5, 'Tuck and Robin Lakes', 'Northwest Forest Pass', 'Rainy ', 4, '2020-03-06 02:37:47', 'Pretty snowy trail. Don’t follow the route from Tuck lake to Robin Lake. Follow the cairns. The trail actually was 16 miles round trip. Pretty lakes, would like to see it in summer', 1, 'Snoqualmie Region', '4,127 feet\r\n', '13.4 miles', 5, 0, 'Tuck and Robin Lakes is a 13.4 mile moderately trafficked out and back trail located near Roslyn, Washington that features a lake and is rated as difficult. The trail offers a number of activity options and is best used from August until October. Dogs are also able to use this trail but must be kept on leash.');

